import { fetchAdminData, approveEvent, fetchUserDetails } from './adminSlice';

// Example action to refresh admin data
export const refreshAdminData = () => (dispatch) => {
    dispatch(fetchAdminData());
};

export const approveEventAction = (eventId) => (dispatch) => {
    dispatch(approveEvent(eventId));
};

export const fetchUserDetailsAction = () => (dispatch) => {
    dispatch(fetchUserDetails());
};
